import Vue from 'vue'
import VueRouter from 'vue-router'
import HomepageComponent from './pages/frontend/HomepageComponent'

Vue.use(VueRouter)

const routes = [
{
    path: '/',
    component: HomepageComponent
}
]

export default new VueRouter({
    routes
})
